(1, '<p> Uma cidade tem 13.500 habitantes, 50% deles tem casa própria. A quantidade de pessoas sem casa própria nesta cidade é :</p>', 'multipla', 10, NULL, 1, '2021-06-11 20:30:28'),
(2, '<p class=\"MsoNormal\" style=\"text-align: center;\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">QUESTÃO\r\n01 -</span></b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">\r\n</span><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:black\">(CAED)\r\nOBSERVE ABAIXO AS FIGURINHAS QUE LÍVIA COLOU NA CAPA DE SEU CADERNO.</span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"text-align: center; font-size: 1rem; width: 257px;\"></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">QUANTAS FIGURINHAS, AO TODO,\r\nLÍVIA COLOU NA CAPA DE SEU CADERNO?<o:p></o:p></span></p>', 'multipla', 1, NULL, 4, '2021-06-15 23:08:11');
