(3, '<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">QUESTÃO\r\n02 -</span></b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">\r\nOBSERVE ABAIXO A SEQUÊNCIA DOS NÚMEROS. ELA SEGUE UM PADRÃO.</span></p><p class=\"MsoNormal\" style=\"text-align: left;\"><img src=\"data:image/png;base64,\" style=\"width: 50%;\" data-filename=\"image.png\"></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><b>QUAL É O NÚMERO QUE COMPLETA\r\nESSA SEQUÊNCIA?</b></font><o:p></o:p></span></p>', 'multipla', 1, NULL, 4, '2021-06-15 23:15:10'),
(4, '<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size: 12pt; line-height: 115%; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">QUESTÃO 3 -</span></b><span style=\"font-size: 12pt; line-height: 115%; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> RESOLVA A OPERAÇÃO QUE ESTÁ NA CHAVE E RESPONDA.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/png;base64,\" style=\"width: 347px;\" data-filename=\"image.png\"></p><p class=\"MsoNormal\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm;mso-fareast-language:PT-BR\">QUAL\r\nÉ A PORTA QUE TEM O NÚMERO SECRETO DA&nbsp; CHAVE?<o:p></o:p></span></p>', 'multipla', 1, NULL, 4, '2021-06-15 23:28:46');
