(10, '<p>1-&nbsp;<span style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\">Em </span><st1:metricconverter productid=\"1989, a\" w:st=\"on\" style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\">1989, a</st1:metricconverter><span style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\"> lista oficial de\r\nbichos ameaçados no Brasil contava com 219 espécies. Em </span><st1:metricconverter productid=\"2003, a\" w:st=\"on\" style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\">2003, a</st1:metricconverter><span style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\"> lista aumentou para\r\n395 espécies. Qual a diferença entre a quantidade de espécies ameaçadas de\r\nextinção em 1989 e a quantidade ameaçada em 2003?</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>', 'multipla', 4, NULL, 6, '2021-06-16 16:35:54'),
(11, '<p>2-&nbsp;<span style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\">A lista\r\ncom o nome das espécies ameaçadas de extinção foi elaborada por 200 cientistas\r\nda Fundação Biodiversistas. O número 200 pode ser decomposto da seguinte forma:</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>', 'multipla', 4, NULL, 6, '2021-06-16 16:38:36'),
(15, '<p>O calendário em anexo mostra o dia da Festa Junina da Escola Lugar de Aprender. Em que dia da semana aconteceu a festa?</p>', 'multipla', 4, NULL, 6, '2021-06-16 17:20:01'),
(16, '<p>4-&nbsp;<span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 12pt; white-space: pre-wrap;\">Tatiana estuda à tarde. O relógio abaixo mostra o horário da merenda de sua turma. </span></p>', 'multipla', 4, NULL, 6, '2021-06-16 17:28:15'),
(17, '<p>5- Qual o total da adição: 2 8 9 + 5 3 5 =</p>', 'multipla', 4, NULL, 6, '2021-06-16 17:33:37'),
