(26, '<p>8.&nbsp;<b style=\"text-indent: -18pt; font-size: 1rem;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></b><span style=\"text-indent: -18pt; font-size: 1rem; font-family: Arial, sans-serif;\">Jorginho foi ao parque de diversões com\r\nsua família. Neste parque havia poucos brinquedos em funcionamento e por isso,\r\nhavia fila para brincar em cada um. No gráfico abaixo, cada retângulo\r\nrepresenta uma criança que aguarda em cada fila, e podemos ver que no bate-bate\r\nhavia 5 crianças na fila.&nbsp;</span></p><p><span style=\"font-family: Arial, sans-serif; font-size: 1rem;\">O\r\nbrinquedo em que há </span><b style=\"font-family: Arial, sans-serif; font-size: 1rem;\">mais </b><span style=\"font-family: Arial, sans-serif; font-size: 1rem;\">crianças na fila&nbsp;é:&nbsp; &nbsp; &nbsp; &nbsp;</span><img src=\"data:image/png;base64,\" style=\"width: 274.391px; height: 222.789px;\" data-filename=\"Questão 8 simulado.png\"></p>', 'multipla', 2, NULL, 7, '2021-06-16 23:07:40');
